import UIKit
import RxSwift

class Home: UIViewController {
    
    @IBOutlet weak var serversTableView:UITableView!
    
    @IBOutlet weak var pinCodeTextField:UITextField!
    @IBOutlet weak var passwordTextField:UITextField!
    
    @IBOutlet weak var optionView:UIView!
    @IBOutlet weak var updateView:UIView!
    @IBOutlet weak var serversView:UIView!
    @IBOutlet weak var accountView:UIView!
    @IBOutlet weak var backgroundView:UIView!
    
    @IBOutlet weak var firstAnimatedView:UIView!
    @IBOutlet weak var secondAnimated:UIView!
    @IBOutlet weak var thirdAnimateView:UIView!
    
    @IBOutlet weak var legalView:UIStackView!
    @IBOutlet weak var helpCenterView:UIStackView!
    
    @IBOutlet var updateName:[UILabel]!
    @IBOutlet weak var pinLabel:UILabel!
    @IBOutlet var updateStatus:[UILabel]!
    @IBOutlet var accountStatus:[UILabel]!
    @IBOutlet var accountExpiry:[UILabel]!
    @IBOutlet weak var byWhoLabel:UILabel!
    @IBOutlet var updateVersion:[UILabel]!
    @IBOutlet weak var expiryLabel:UILabel!
    @IBOutlet weak var autoNameLabel:UILabel!
    @IBOutlet weak var autoLocationLabel:UILabel!

    @IBOutlet weak var legalButton:UIButton!
    @IBOutlet weak var topUpButton:UIButton!
    @IBOutlet weak var helpCenterButton:UIButton!
    @IBOutlet weak var optionViewButton:UIButton!
    @IBOutlet weak var updateViewButton:UIButton!
    @IBOutlet weak var serversViewButton:UIButton!
    @IBOutlet weak var accountViewButton:UIButton!
    @IBOutlet weak var selectAutoServerButton:UIButton!
    @IBOutlet weak var connectToThisServerButton:UIButton!
    @IBOutlet weak var connectButton:UIButton!

    @IBOutlet var updateIcons:[UIImageView]!
    @IBOutlet weak var autoImageView:UIImageView!
    @IBOutlet weak var autoImageCheckBoxView:UIImageView!
    @IBOutlet var accountStatusIcons:[UIImageView]!
    @IBOutlet weak var leftServersButtonImage: UIImageView!
    @IBOutlet weak var rightServersButtonImage: UIImageView!
    @IBOutlet weak var mainAnimationImageVIew: UIImageView!
    @IBOutlet weak var mainAnimationStatusImageVIew: UIImageView!
    @IBOutlet weak var mainAnimationMessageImageVIew: UIImageView!
    @IBOutlet weak var mainAnimationMessageLabel: UILabel!

    var timer:Timer?

    var animatedViewImages:[String] = [      "",
                                             
                                             "",
                                             
                                             "      "
    ]
    
    var uiStacks = [UIView]()
    var disposeBag = DisposeBag()
    let client = APIClient.shared
    var isConnected = false
    
    var servers = [ServerResponse]()
    
    var selectedID:Double?
    
    override func viewDidLoad() {
        
        super.viewDidLoad()
        setupUI()
        self.hideKeyboardWhenTappedAround()
    }
    
    override func viewWillAppear(_ animated: Bool) {
        
        hideAllView(withoutView: nil)
        clearConnectionDetails()
    }
    
    func hideAllView(withoutView:UIView?) {
        
        uiStacks.forEach { view in
            if view !== withoutView {
                view.alpha = 0
                view.isHidden = true
            }
        }
    }
    
    func setupUI() {

        serversTableView.delegate = self
        serversTableView.dataSource = self
        serversTableView.register(UINib(nibName: "ServersCell", bundle: nil), forCellReuseIdentifier: "serverCell")
        
        uiStacks = [optionView, helpCenterView, legalView, accountView, updateView, serversView]
        
        pinCodeTextField.attributedPlaceholder = NSAttributedString(string: "Enter PIN",
                                                                    attributes: [NSAttributedString.Key.foregroundColor: UIColor.darkGray])
        passwordTextField.attributedPlaceholder = NSAttributedString(string: "Enter Password",
                                                                     attributes: [NSAttributedString.Key.foregroundColor: UIColor.darkGray])
        
        mainAnimationImageVIew.image = animatedViewImages.first?.toImage()
        mainAnimationImageVIew.layer.cornerRadius = mainAnimationImageVIew.frame.width / 2 - 1000
        
        mainAnimationStatusImageVIew.isHidden = true
        mainAnimationMessageImageVIew.isHidden = true
        mainAnimationMessageLabel.isHidden = true

        setupActions()
        setupAnimatedView()
    }
    
    func setupAnimatedView() {
        
        var style = [false, true , false]
        
        timer?.invalidate()
        timer = nil
        
        timer = Timer.scheduledTimer(withTimeInterval: 2, repeats: true) { (timer) in
         
            DispatchQueue.main.async {
                    
                UIView.animate(withDuration: 2) {
                    self.firstAnimatedView.transform = CGAffineTransform(scaleX: style[0] ? 1.04 : 1, y: style[0] ? 1.02 : 1)
                    self.firstAnimatedView.backgroundColor = self.isConnected ? UIColor(red: 0.75, green: 0.83, blue: 0.95, alpha: 1.00) : UIColor(red: 0.92, green: 0.92, blue: 0.92, alpha: 1.00)
                }
                
                UIView.animate(withDuration: 2) {
                    self.secondAnimated.transform = CGAffineTransform(scaleX: style[1] ? 1.04 : 1, y: style[1] ? 1.02 : 1)
                    self.secondAnimated.backgroundColor = self.isConnected ? UIColor(red: 0.07, green: 0.45, blue: 0.87, alpha: 1.00) : UIColor(red: 0.75, green: 0.75, blue: 0.75, alpha: 1.00)
                }
                
                UIView.animate(withDuration: 2) {
                    self.thirdAnimateView.transform = CGAffineTransform(scaleX: style[2] ? 1.02 : 1, y: style[2] ? 1.02 : 1)
                    self.thirdAnimateView.backgroundColor = self.isConnected ? UIColor(red: 0.00, green: 0.30, blue: 0.81, alpha: 1.00) : UIColor.darkGray
                }
                
                style[0] = !style[0]
                style[1] = !style[1]
                style[2] = !style[2]
            }
        }
    }
    
    func setupActions() {
        
        pinCodeTextField.rx.controlEvent(.editingDidEnd).subscribe(onNext: {
            self.loadAccount()
        }).disposed(by: self.disposeBag)
        
        passwordTextField.rx.controlEvent(.editingDidEnd).subscribe(onNext: {
            self.loadAccount()
        }).disposed(by: self.disposeBag)
        
        helpCenterButton.rx.tap.subscribe(onNext: {
            self.helpCenterButton.setImage(UIImage(named: self.helpCenterView.isHidden ? "arrow_down" : "arrow_up"), for: .normal)
            self.showHideSomeView(view: self.helpCenterView, isNeedHideAll: false)
        }).disposed(by: self.disposeBag)
        
        legalButton.rx.tap.subscribe(onNext: {
            self.legalButton.setImage(UIImage(named: self.legalView.isHidden ? "arrow_down" : "arrow_up"), for: .normal)
            self.showHideSomeView(view: self.legalView, isNeedHideAll: false)
        }).disposed(by: self.disposeBag)
        
        optionViewButton.rx.tap.subscribe(onNext: {
            self.showHideSomeView(view: self.optionView, isNeedHideAll: false)
        }).disposed(by: self.disposeBag)

        serversViewButton.rx.tap.subscribe(onNext: {
            self.loadServer()
        }).disposed(by: self.disposeBag)
        
        accountViewButton.rx.tap.subscribe(onNext: {
            self.showHideSomeView(view: self.accountView, isNeedHideAll: false)
        }).disposed(by: self.disposeBag)
        
        updateViewButton.rx.tap.subscribe(onNext: {
            self.getUpdates()
        }).disposed(by: self.disposeBag)
        
        topUpButton.rx.tap.subscribe(onNext: {
            self.topUp()
        }).disposed(by: self.disposeBag)
        
        selectAutoServerButton.rx.tap.subscribe(onNext: {
            
            if let indexPath = self.serversTableView.indexPathForSelectedRow {
                self.serversTableView.deselectRow(at: indexPath, animated:  true)
            }
            
            self.autoImageCheckBoxView.image = UIImage(named: "selected_circle")
        }).disposed(by: self.disposeBag)
        
        connectToThisServerButton.rx.tap.subscribe(onNext: {
            self.connect()
        }).disposed(by: self.disposeBag)
        
        connectButton.rx.tap.subscribe(onNext: {
            self.connect()
        }).disposed(by: self.disposeBag)
    }
    
    private func connect() {
        
        var id:Double?
        self.rightServersButtonImage.isHidden = true
        self.leftServersButtonImage.isHidden = false
        mainAnimationImageVIew.image = animatedViewImages[2].toImage()

        if let indexPath = serversTableView.indexPathForSelectedRow {
            id = servers[indexPath.row + 1].id
            self.leftServersButtonImage.image = servers[indexPath.row + 1].logo?.toImage()
        }
        else if servers.count > 0 {
            id = servers[0].id
        }
        
        guard let id = id else {
            self.mainAnimationMessageImageVIew.isHidden = false
            self.mainAnimationMessageLabel.isHidden = false
            self.mainAnimationMessageLabel.text = "Servers not loaded"

            DispatchQueue.main.asyncAfter(deadline: .now() + 2) {
                self.mainAnimationStatusImageVIew.isHidden = true
                self.mainAnimationMessageImageVIew.isHidden = true
                self.mainAnimationMessageLabel.isHidden = true
            }
            
            self.rightServersButtonImage.isHidden = false
            self.leftServersButtonImage.isHidden = true
            mainAnimationImageVIew.image = animatedViewImages[0].toImage()
            return
        }
        
        selectedID = id
        
        client.getServerDetail(id: id).subscribe(onNext: { response in
            
            guard let success = response.success, success == 1 else {
                DispatchQueue.main.async {
                    if !self.serversView.isHidden {
                        self.showHideServers()
                    }
                    self.mainAnimationImageVIew.image = self.animatedViewImages[0].toImage()
                    self.mainAnimationMessageImageVIew.isHidden = false
                    self.mainAnimationMessageLabel.isHidden = false
                    self.mainAnimationMessageLabel.text = response.message ?? "Server error"

                    DispatchQueue.main.asyncAfter(deadline: .now() + 2) {
                        self.mainAnimationStatusImageVIew.isHidden = true
                        self.mainAnimationMessageImageVIew.isHidden = true
                        self.mainAnimationMessageLabel.isHidden = true
                    }
                    
                }
                
                return
            }
            
            IPreference.server = response
            self.isConnected = true
            DispatchQueue.main.async {
                self.mainAnimationStatusImageVIew.isHidden = false
                self.mainAnimationStatusImageVIew.image = UIImage(named: "success")
                self.connectButton.setTitle("Connected", for: .normal)
                self.serversViewButton.setTitle("Disconnect", for: .normal)
                self.leftServersButtonImage.isHidden = true
                self.mainAnimationImageVIew.image = self.animatedViewImages[1].toImage()
                                
                if !self.serversView.isHidden {
                    self.showHideServers()
                }
            }
            
        }).disposed(by: self.disposeBag)
    }
    
    private func getUpdates() {
        
        if self.updateView.isHidden  {
            client.getUpdateInfo().subscribe(onNext: { response in
                guard let success = response.success, success == 1 else { return }
                
                if let updateDetails = response.updateDetails, !updateDetails.isEmpty {
                    for i in 0..<updateDetails.count {
                        DispatchQueue.main.async {
                            self.updateIcons[i].image = updateDetails[i].logo?.toImage()
                            self.updateName[i].text = updateDetails[i].name
                            self.updateVersion[i].text = updateDetails[i].version
                            self.updateStatus[i].text = updateDetails[i].update
                        }
                    }
                    
                    self.showHideSomeView(view: self.updateView, isNeedHideAll: false)
                }

            }).disposed(by: self.disposeBag)
        }
        else {
            self.showHideSomeView(view: self.updateView, isNeedHideAll: false)
        }
    }
    
    private func showHideSomeView(view:UIView, isNeedHideAll:Bool = true) {
        
        DispatchQueue.main.async {
            
            if isNeedHideAll {
                self.hideAllView(withoutView: view)
            }
            
            UIView.animate(withDuration: 0.3) {
                view.alpha = view.alpha == 0 ? 1 : 0
                view.isHidden = !view.isHidden
            }
        }
    }
    
    private func clearConnectionDetails() {
        
        DispatchQueue.main.async {
            self.pinLabel.text = "Log in to access"
            self.expiryLabel.text = "Expiry data"
            self.byWhoLabel.text = "Jailbreak VPN"
            
            for i in 0..<self.accountStatusIcons.count {
                self.accountStatus[i].text = "inactive"
                self.accountStatusIcons[i].image = UIImage(named: "incorrect")
                self.accountExpiry[i].text = "N/A"
            }
        }
    }
    
    private func updateConnectionDetails() {
        
        DispatchQueue.main.async {
            
            let accountUser = IPreference.accountUser
            self.pinLabel.text = accountUser?.pass
            self.expiryLabel.text = "Expiry Date: \(accountUser?.expireDate ?? "")"
            self.byWhoLabel.text =  accountUser?.sellerName
        }
    }
    
    private func loadAccount() {
        
        guard let pin = pinCodeTextField.text, !pin.isEmpty else {
            clearConnectionDetails()
            return
        }
        
        guard let password = passwordTextField.text, !password.isEmpty else {
            clearConnectionDetails()
            return
        }
        
        let accountUserData = AccountUser(_pin: pin, _pass: password, _expireDate: "", _sellerName: "")
        IPreference.accountUser = accountUserData
        
        do{
            client.getAccountInfo().subscribe(
                onNext: { result in
                    
                    guard let success = result.success, success == 1 else {
                        self.clearConnectionDetails()
                        return
                    }
                    
                    var expireDate = ""
                    var i = 0
                    result.subscriptionDetails?.forEach({ subscription in
                        
                        if (subscription.status == "active") {
                            expireDate = (subscription.expiry != nil) ? subscription.expiry! : ""
                        }
                        
                        DispatchQueue.main.async {
                            self.accountStatus[i].text = subscription.status
                            self.accountStatusIcons[i].image = subscription.status == "active" ? UIImage(named: "success") : UIImage(named: "incorrect")
                            self.accountExpiry[i].text = (subscription.expiry != nil) ? subscription.expiry! : ""
                            i += 1
                        }
                    })
                    
                    let accountUser = IPreference.accountUser
                    
                    accountUser?.sellerName = result.resellerName ?? ""
                    accountUser?.expireDate = expireDate
                    IPreference.accountUser = accountUser
                    self.updateConnectionDetails()
                },
                onError: { error in
                    print(error.localizedDescription)
                },
                onCompleted: {
                    
                }).disposed(by: self.disposeBag)
        }
    }
    
    func topUp() {
        
        if let url = URL(string: "https://jailbreakvpn.com/topup") {
            UIApplication.shared.open(url)
        }
    }
    
    func showHideServers() {
        
        if !isConnected {
            DispatchQueue.main.async {
                self.mainAnimationImageVIew.image = self.animatedViewImages[0].toImage()
            }
        }
        
        DispatchQueue.main.async {
            if let firstServer = self.servers.first {
                self.autoImageView.image = firstServer.logo?.toImage()
                self.autoNameLabel.text = firstServer.name
                self.autoLocationLabel.text = firstServer.location
            }
            
            self.autoImageCheckBoxView.image = UIImage(named: "selected_circle")
            self.serversTableView.reloadData()
            self.backgroundView.isHidden = !self.backgroundView.isHidden
            self.showHideSomeView(view: self.serversView, isNeedHideAll: false)
        }
    }
    
    private func loadServer() {
        
        if !isConnected {
            
            do{
                client.getListServer().subscribe(
                    onNext: { result in
                        
                        if !result.isEmpty {
                            
                            self.servers = result
                            self.showHideServers()
                        }
                        
                    },
                    onError: { error in
                        print(error.localizedDescription)
                    },
                    onCompleted: {
                        
                    }).disposed(by: self.disposeBag)
            }
        }
        else {
            isConnected = false
            IPreference.server = nil
            DispatchQueue.main.async {
                self.mainAnimationStatusImageVIew.isHidden = true
                self.rightServersButtonImage.isHidden = false
                self.leftServersButtonImage.isHidden = true
                self.connectButton.setTitle("Connect", for: .normal)
                self.serversViewButton.setTitle("Select Location", for: .normal)
                self.mainAnimationImageVIew.image = self.animatedViewImages[0].toImage()
            }
        }
    }
}

extension Home:UITableViewDelegate, UITableViewDataSource {
    func tableView(_ tableView: UITableView, numberOfRowsInSection section: Int) -> Int {
        return servers.count > 0 ? servers.count - 1 : 0
    }
    
    func tableView(_ tableView: UITableView, cellForRowAt indexPath: IndexPath) -> UITableViewCell {
        let cell = tableView.dequeueReusableCell(withIdentifier: "serverCell") as! ServersCell
        let server = servers[indexPath.row + 1]
        
        if server.id == selectedID {
            cell.selectedIcon.image = UIImage(named: "selected_cirlce")
            self.autoImageView.image = UIImage(named: "circle")
        }
        
        cell.serverName.text = server.name
        cell.serverSubName.text = server.location
        cell.icon.image = server.logo?.toImage()
        cell.selectionStyle = .none
        
        return cell
    }
    
    func tableView(_ tableView: UITableView, didSelectRowAt indexPath: IndexPath) {
        self.autoImageCheckBoxView.image = UIImage(named: "circle")
    }
}
